        .extra-margin {
margin-bottom: 20px;
}
body.page-id-8 .page-header .page-visual span{background-position: center top;}
#container-map button.left .title {margin-left:4px;}
#container-map [data-cat="icef-mexico-colombia-agent-roadshow"].left  span {  margin-left: -31px; }
@media screen and (min-width: 992px)
{
  #workshop-overview :nth-child(5) {
    width: 25%;
    clear:both;
  }
  #workshop-overview :nth-child(5) header {
    width: 100%;
    padding-bottom: 100%;
    float: none;
    margin-right: 0;
  }

  #workshop-overview :nth-child(5) > div {
    float: none;
    display: block;
    margin-top: 0;
    width: auto;
  }

  #workshop-overview :nth-child(5) > div a {
    float: none;
    width: 100%;
    margin-right: 0;
  }
}
#workshop-overview :nth-child(6){
  margin-top:30px;
}
@-moz-document url-prefix() {
header ul#menu-main-menu {font-size:14px;} 
body, .testimonial p.name, .workshop .absolute-top .quick-info {font-size: 15px;}
.rss-item a, .number-box .desc, .link-box.lbx-small, .link-box .desc, #workshop-overview .link-box .flip-container .desc {font-size: 13px}
#menu-footer > li > .dropdown-menu {font-size: 11px;}
}
p.reg-price {font-size: .7em;}
table.data-table th {padding-top: 15px; line-height: 35px;}
th.label {font-size:100%; color:#333; font-weight:normal;}

.close-cross:before {
    content: "✕";
}

.checkmark:before {
    content: "✔";
}

.tribe-events-calendar thead th {background-color: #195ba8; border-left: 1px solid #195ba8; border-right: 1px solid #195ba8;}

#tribe-bar-form .tribe-bar-submit input[type="submit"] {background: #195ba8;}

a.tribe-events-ical.tribe-events-button, a.tribe-events-gcal.tribe-events-button {background-color: #195ba8 !important;}

h2.tribe-events-page-title {font-size: 28px; font-weight: 500; color: #195ba8;}

.single-tribe_events h2.tribe-events-single-event-title {font-size: 28px;
color: #195ba8;}
#tribe-events-content .tribe-events-tooltip h4 {color: #195ba8;}
#tribe-bar-form {background: #fbfbfb;}

.tribe-events-tooltip {z-index: 1100 !important;}

article.partner div a[target="_blank"]::after {
	content: "";
}
article.partner .img a::before {
    border: medium none;
}
#bwg_container1_0 #bwg_container2_0 .bwg_album_extended_div_0 {
  height: 230px !important;
}


/**
Advertising and Sponsorship
**/

.table-row {
  display: table;
}
.left-side {
  float: none;
  display: table-cell;
}
.right-side {
  float: none;
  display: table-cell;
}
.brand-advantage{
margin-bottom: 35px;
font-size: 16px;
}
.icef-product-widget{
text-align: center;
}
.icef-product-widget .img-border{
padding-top: 45px;
width: 150px;
height: 150px;
margin-left: auto;
margin-right: auto;
}
.icef-product-widget img{

}

.icef-product-widget h2{
margin-top: 0;
margin-bottom: 5px;
font-size: 23px;
}
.icef-product-widget p{
 width: 250px;
margin-left: auto;
margin-right: auto;
}

.icef-promotional-widget h3{
background-color:#195ba8;
height:70px;
color:white;
text-align:center;
font-size:24px;
margin-top:0;
line-height: 70px;
}

#slider_8321 .owl-item .left img{
margin-bottom: 20px;
}
#slider_8321 .owl-item .left{
float: left;
margin-top: 45px;
}
#slider_8321 .owl-item .right{
position:relative;
float:left;
}
#slider_8321 .owl-item .right .big-quote, #slider_8840 .owl-item .right .big-quote{
    position: absolute;
    font-size: 100px;
    margin-top: -25px;
    color: #195ba8;
    font-family: sans-serif;
    webkit-transform: rotate(180deg);
    -moz-transform: rotate(180deg);
    -o-transform: rotate(180deg);
    -ms-transform: rotate(180deg);
    transform: rotate(180deg);
    height: 84px;
}
#slider_8321 .owl-item .right .content{
margin-left: 42px;
}
#slider_8321 .owl-item .right h3, .quotee{
font-weight: bold;
margin-top: 0;
margin-bottom: 5px;
}
#slider_8321.owl-carousel .owl-stage-outer{
margin-top: -30px;
}
.video-embed {
position: relative;
padding-bottom: 56.25%;
padding-top: 30px; height: 0; overflow: hidden;
}

.video-embed iframe {
position: absolute;
top: 0;
left: 0;
width: 100%;
height: 100%;
}

/**
strange one-off orange button on bottom of advertising page
**/
.btn.btn-orange{
    background-color: #ff6600;
    border-color: #e54018;
    color: white;
}
.btn.btn-orange:hover,.btn.btn-orange:focus,.btn.btn-orange:active{
background-color: #e9522d;
    border-color: #ef5e3a;
}

/**
Download brochure link
**/

.advertising-download.link-box.lbx-small:after {
    border-top: 35px solid transparent;
    border-right: 35px solid #ff6600;
  }

#icef-custom-pages-main h1{
font-size: 25px;
}      




